new class{constructor(){this.accountBtn=null,this.tabButtons=null,this.tabContents=null,this.init()}init(){"loading"===document.readyState?document.addEventListener("DOMContentLoaded",(()=>this.setup())):this.setup()}setup(){this.insertAccountButton(),this.setupTabElements(),this.setupEventListeners()}insertAccountButton(){const t=document.querySelector(".logout-btn");if(t){const e=document.createElement("button");e.className="account-btn",e.textContent="Account",t.parentNode.insertBefore(e,t),this.accountBtn=e}}setupTabElements(){this.tabButtons=document.querySelectorAll(".tab-button"),this.tabContents=document.querySelectorAll(".tab-content")}setupEventListeners(){this.tabButtons?.forEach((t=>{t.addEventListener("click",(()=>this.switchTab(t.dataset.tab)))}))}switchTab(t){if(!this.tabButtons||!this.tabContents)return;this.tabButtons.forEach((t=>t.classList.remove("active"))),this.tabContents.forEach((t=>t.classList.remove("active")));const e=Array.from(this.tabButtons).find((e=>e.dataset.tab===t)),s=Array.from(this.tabContents).find((e=>e.id===t));e&&s&&(e.classList.add("active"),s.classList.add("active"))}};